function login (setLoggedIn){
    return(
        <div>
            <h1>Login</h1>
        </div>
    )
}
function register (){
    return(
        <div>
            <h1>Logout</h1>
        </div>
    )
}


function exterior(children, setLoggedIn ){

    return(
        <div>
            <button onClick={() => setLoggedIn(false)}>Logout</button>
            {children}
        </div>
    )
}
export function UserContext({children}){
    const [loggedIn, setLoggedIn] = useState(true);
    return(
        <div>
            {loggedIn ? exterior(children, setLoggedIn) : login(setLoggedIn)} 
        </div>
    )
}
